import React from "react";
import "./Styling/NavBar.css";
import {Link} from "react-router-dom";
const NavBar = () => {
  return (
    <div className="navBar">
      <ul>
        <li>Home</li>
        <div className="links">
          <li><Link to="/about/">About</Link></li>
          <li>Skills+Certifications</li>
          <li>Projects</li>
          <li>Contact</li>
        </div>
      </ul>
    </div>
  );
};
export default NavBar;
